import React, { useState } from 'react';

const Entry = () => {
  const [entryData, setEntryData] = useState({
    day: '',
    feeling: '',
    busy: '',
    happy: '',
    grateful: '',
  });
  const [insights, setInsights] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEntryData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Simulate bot insight generation
    const insight = `ðŸŒ¸ Oh, how lovely! It sounds like you had a ${entryData.feeling.toLowerCase()} day! Your happiness from ${entryData.happy} and gratitude for ${entryData.grateful} really shine through. Keep nurturing those positive vibes! âœ¨`;
    setInsights(insight);
  };

  const handleBotChat = () => {
    alert('Letâ€™s chat with SereneAI about your day! ðŸ˜Š (Feature coming soon)');
    // Add chat logic here (e.g., open a modal or redirect)
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-pink-100 to-pink-200 p-6 font-nunito">
      <h1 className="text-4xl font-sacramento text-pink-600 text-center mb-8 animate-pulse">ðŸŒ¸ My Journal Entry ðŸŒ¸</h1>

      {/* Notebook Layout */}
      <div className="max-w-3xl mx-auto bg-white p-6 rounded-xl shadow-lg border-4 border-pink-300 relative overflow-hidden">
        {/* Ruled Lines Background with CSS */}
        <div className="absolute inset-0 opacity-10" style={{
          backgroundImage: `repeating-linear-gradient(to bottom, transparent 0, transparent 24px, #ccc 24px, #ccc 25px)`,
        }}></div>

        {/* Entry Form */}
        <form onSubmit={handleSubmit} className="space-y-6 relative z-10">
          <div>
            <h2 className="text-xl font-sacramento text-pink-600 mb-2">ðŸŒ¼ How my day went?</h2>
            <textarea
              name="day"
              value={entryData.day}
              onChange={handleInputChange}
              className="w-full h-24 p-3 rounded-lg border-2 border-pink-200 focus:outline-none focus:ring-2 focus:ring-pink-400 text-pink-800 bg-pink-50 resize-none"
              placeholder="Type here..."
            />
          </div>
          <div>
            <h2 className="text-xl font-sacramento text-pink-600 mb-2">ðŸŒ¸ How am I feeling?</h2>
            <textarea
              name="feeling"
              value={entryData.feeling}
              onChange={handleInputChange}
              className="w-full h-24 p-3 rounded-lg border-2 border-pink-200 focus:outline-none focus:ring-2 focus:ring-pink-400 text-pink-800 bg-pink-50 resize-none"
              placeholder="Type here..."
            />
          </div>
          <div>
            <h2 className="text-xl font-sacramento text-pink-600 mb-2">ðŸŒ¿ What kept me busy?</h2>
            <textarea
              name="busy"
              value={entryData.busy}
              onChange={handleInputChange}
              className="w-full h-24 p-3 rounded-lg border-2 border-pink-200 focus:outline-none focus:ring-2 focus:ring-pink-400 text-pink-800 bg-pink-50 resize-none"
              placeholder="Type here..."
            />
          </div>
          <div>
            <h2 className="text-xl font-sacramento text-pink-600 mb-2">ðŸŒž What made me happy today?</h2>
            <textarea
              name="happy"
              value={entryData.happy}
              onChange={handleInputChange}
              className="w-full h-24 p-3 rounded-lg border-2 border-pink-200 focus:outline-none focus:ring-2 focus:ring-pink-400 text-pink-800 bg-pink-50 resize-none"
              placeholder="Type here..."
            />
          </div>
          <div>
            <h2 className="text-xl font-sacramento text-pink-600 mb-2">ðŸŒ· What am I grateful for today?</h2>
            <textarea
              name="grateful"
              value={entryData.grateful}
              onChange={handleInputChange}
              className="w-full h-24 p-3 rounded-lg border-2 border-pink-200 focus:outline-none focus:ring-2 focus:ring-pink-400 text-pink-800 bg-pink-50 resize-none"
              placeholder="Type here..."
            />
          </div>

          {/* Submit Button */}
          <div className="text-center mt-6">
            <button
              type="submit"
              className="bg-gradient-to-r from-pink-300 to-pink-400 text-white font-bold py-3 px-6 rounded-full shadow-md hover:bg-pink-500 hover:scale-110 transition-all duration-300 ease-in-out text-lg animate-bounce"
            >
              âœ¨ Submit My Entry! ðŸŒ¸
            </button>
          </div>
        </form>

        {/* SereneAI Bot Button */}
        <div className="text-center mt-4">
          <button
            onClick={handleBotChat}
            className="bg-pink-200 text-pink-800 font-bold py-2 px-4 rounded-full shadow-md hover:bg-pink-300 hover:scale-105 transition-all duration-300 ease-in-out flex items-center justify-center mx-auto"
          >
            ðŸ¤– Want to discuss about your day?
          </button>
        </div>

        {/* Insights Section */}
        {insights && (
          <div className="mt-6 p-4 bg-pink-50 rounded-lg border-2 border-pink-200">
            <h3 className="text-xl font-sacramento text-pink-600 mb-2">ðŸŒŸ SereneAI Insights ðŸŒŸ</h3>
            <p className="text-pink-800">{insights}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Entry;
